import React,{useState} from 'react'

function Projects(props) {
  const initialState = {
    inputSearch: "",
  };
  const [state, setState] = useState(initialState);

  const handleChange = (e) => {
    setState({
      ...state,
      [e.target.name]: e.target.value,
    });
  };
  return (
    <div className='projects'>

    </div>
  )
}

export default Projects
